import React, { useEffect, useState } from "react";
import "./ManageKoi.scss";
import Navbar from "../../common/Navbar/Navbar";
import VerticallyNavbar from "../../common/Navbar/VerticallyNavbar";
import { handleGetAllFish } from "../../../axios/UserService";

const ManageKoi = () => {
  const [listKois, setListKois] = useState([]);

  const getListKois = async () => {
    const res = await handleGetAllFish();
    // console.log(res.data.$values);
    setListKois(res.data.$values);
  };

  useEffect(() => {
    getListKois();
  }, []);

  return (
    <div className="manage-koi-container">
      <div className="header">
        <Navbar></Navbar>
      </div>
      <div className="body-content">
        <VerticallyNavbar></VerticallyNavbar>
        <div className="body-content-right">
          <div className="search">
            <div className="search-text">Search: </div>
            <div className="search-value">
              {" "}
              <input
                className="search-input"
                placeholder="Search by Email and Phone number"
                type="text"
              />
              <div className="search-icon">
                <img src="../assets/images/search.svg" alt="" />
              </div>
            </div>
          </div>
          <table className="table-manage-koi">
            <thead>
              <tr>
                <th>No</th>
                <th>Fish ID</th>
                <th>Fish Name</th>
                <th>Create Date</th>
                <th>Create By</th>
                <th>Status</th>
                <th></th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>1</td>
                <td>1</td>
                <td>Thinh</td>
                <td>YYYY/MM/DD hh:mm:ss</td>
                <td>Thinh Dinh</td>
                <td>Active</td>
                <td>
                  <a href="#">
                    <i className="fa-solid fa-arrow-right"></i>
                  </a>
                </td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default ManageKoi;
